const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><img parentName="p" {...{
        "src": "https://ottaaproject.com/img/ottaa-project.svg",
        "alt": "picture"
      }}></img></p>
    <h1 {...{
      "id": "how-to-contribute"
    }}>{`How to contribute`}</h1>
    <p>{`We would love your help. Before you start working however, please read and follow this guide.`}</p>
    <h2 {...{
      "id": "reporting-issues"
    }}>{`Reporting Issues`}</h2>
    <p>{`Provide a lot of information about the bug. Mention the version of OTTAA Project and explain how the problem can be reproduced.`}</p>
    <h2 {...{
      "id": "code-contributions"
    }}>{`Code Contributions`}</h2>
    <h3 {...{
      "id": "create-a-pull-request"
    }}>{`Create a pull request`}</h3>
    <p>{`In order to create a pull request is necessary `}</p>
    <ul>
      <li parentName="ul">{`Avoid file conflicts with the source code`}</li>
      <li parentName="ul">{`Should make a description about the characteristics to apply`}</li>
      <li parentName="ul">{`Should apply the pull request in the corresponding branch`}</li>
    </ul>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Branch`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Version`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Main`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Feature`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Add new features`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Hotfix`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Hot-fix about a version`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Bugfix`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Bug-fix about a version`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "documentation"
    }}>{`Documentation`}</h2>
    <h3 {...{
      "id": "comments"
    }}>{`Comments`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Comment documenting the source code are required.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Comment a class explaining the purpose of that and how to implements if that required.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Comment should be formatted as proper English sentences.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`use Javadoc documentation.`}</p>
      </li>
    </ul>
    <h2 {...{
      "id": "code"
    }}>{`Code`}</h2>
    <h3 {...{
      "id": "duplication"
    }}>{`Duplication`}</h3>
    <ul>
      <li parentName="ul">{`Don't copy-paste source code. Reuse it.`}</li>
    </ul>
    <h3 {...{
      "id": "import-libraries"
    }}>{`Import Libraries`}</h3>
    <ul>
      <li parentName="ul">{`Sort by category.`}</li>
    </ul>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Category`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Google`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Library related to google`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Android`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Library related to android`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Firebase`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Library related to firebase api`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Test`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Library related to test app`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Library`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Library related to different apps`}</td>
        </tr>
      </tbody>
    </table>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Sort by alphabetical order.  `}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Use Grandle level app
Example :`}</p>
      </li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`#!xml
dependencies {
   implementation 'library'  
}
`}</code></pre>
    <h3 {...{
      "id": "indentation"
    }}>{`Indentation`}</h3>
    <p>{` Switch case `}</p>
    <pre><code parentName="pre" {...{}}>{`#!java
Align by  such as these cases :

Switch(value){
    case 0:
       // Todo action here
    break;
    Default:
       // Todo default action here
    break;
}
`}</code></pre>
    <p>{`If / else or else if `}</p>
    <pre><code parentName="pre" {...{}}>{`#!java

if(value.toString().equals("Hello")){
  //To do action here
}else if{
  // To do action here
} else{
  // Todo 
}

`}</code></pre>
    <p><strong parentName="p">{`Remember: `}</strong></p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`The attributes of the class must be protected or private`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`The Method of the class must be public, private or protected`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`The class must be public or private`}</p>
      </li>
    </ul>
    <h3 {...{
      "id": "naming"
    }}>{`Naming`}</h3>
    <p><strong parentName="p">{` Name:`}</strong>{` That must be transparent and representative about the action to show us.`}</p>
    <p><strong parentName="p">{`Class:`}</strong>{` should be nouns in UpperCamelCase, with the first letter of every word capitalized.
example :`}</p>
    <pre><code parentName="pre" {...{}}>{`#!java
public class Json(){

}
`}</code></pre>
    <p><strong parentName="p">{`variable:`}</strong>{` 	Local variables, instance variables, and class variables are also written in lowerCamelCase.`}</p>
    <p>{`example :`}</p>
    <pre><code parentName="pre" {...{}}>{`#!java

String name =" Carl";
String fileName="json.txt";
`}</code></pre>
    <p><strong parentName="p">{`Constant:`}</strong>{` Constants should be written in uppercase characters separated by underscores.`}</p>
    <p>{`example :`}</p>
    <pre><code parentName="pre" {...{}}>{`#!java

public static final String CONSTANT_NAME=" fileName.txt";
`}</code></pre>
    <h3 {...{
      "id": "firebase-index"
    }}>{`Firebase index:`}</h3>
    <p>{`This is the Three in firebase :`}</p>
    <pre><code parentName="pre" {...{}}>{`#!code

index
├── Edad
├── email
├── Fotos
|    ├── nombre_foto
|    └── url_foto
├── FotosUsuario
├── Frases
├── Grupos
├── Juegos
├── Pago
├── Pictos
├── PrimeraUltimaConexion
├── Usuarios
└── Version
`}</code></pre>
    <h3 {...{
      "id": "how-to-setup-the-files"
    }}>{`How to setup the files`}</h3>
    <p>{` OTTAA Project uses different's apis in order to offer different kinds of functions such as the location in the prediction and the google translate  language that's was implemented with the smart talk function.`}</p>
    <p>{` OTTAA Project uses this Rest api :`}</p>
    <ol>
      <li parentName="ol">{`Google places`}</li>
      <li parentName="ol">{`Firebase`}</li>
      <li parentName="ol">{`Google Translate`}</li>
      <li parentName="ol">{`Galeria Araasac`}</li>
    </ol>
    <p>{`In order to set up the files follow these steps :`}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`Go to the folder values : "/app/src/main/res/values"`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`create a new xml files `}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`copy this line of code`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`<?xml version="1.0" encoding="utf-8"?>
<resources>
   <string name="places_api_key"> Replacement with the google places api key </string>
   <string name="galeria_araasac_api_key"> Replacement with the galeria araasac api key </string>
   <string name="google_translate_api_key"> Replacement with the google translate api key </string>
   <string name="firebase_name_database"> Replacement with the firebase database path </string>
</resources>
`}</code></pre>
      </li>
    </ol>
    <pre><code parentName="pre" {...{}}>{` 
`}</code></pre>
    </MDXLayout>;
}

;
